import { useState, useEffect } from 'react';
import { Outlet, Link } from "react-router-dom";
import Block from './profileblock';
import { NavLink } from "react-router-dom";

import jsonData from './info.json'


function Main() {
  const [topic, setTopic] = useState('all')

  console.log(jsonData)

  const col1 = [];
  const col2 = [];
  const col3 = [];
  let val = 0;

  for (let i = 0; i < jsonData.length; i++) {
    if (topic == 'all') {
      if (i%3 == 0) {
        col1.push(<Block genre = {jsonData[i]["genre"]} text = {jsonData[i]["text"]} img = {jsonData[i]["img"]}/>);
      } else if (i%3 == 1) {
        col2.push(<Block genre = {jsonData[i]["genre"]} text = {jsonData[i]["text"]} img = {jsonData[i]["img"]}/>);
      } else {
        col3.push(<Block genre = {jsonData[i]["genre"]} text = {jsonData[i]["text"]} img = {jsonData[i]["img"]}/>);
      }
    } else {
      if (jsonData[i]["genre"] == topic) {
        if (val%3 == 0) {
          col1.push(<Block genre = {jsonData[i]["genre"]} text = {jsonData[i]["text"]} img = {jsonData[i]["img"]}/>);
        } else if (val%3 == 1) {
          col2.push(<Block genre = {jsonData[i]["genre"]} text = {jsonData[i]["text"]} img = {jsonData[i]["img"]}/>);
        } else {
          col3.push(<Block genre = {jsonData[i]["genre"]} text = {jsonData[i]["text"]} img = {jsonData[i]["img"]}/>);
        }
        val++;
      }
    }
  }


  return (
    <div className="container">
      <div className='header'>
        <Link to={'/'} className='linkstyle'>
        <p className='headline'>Stories From Home</p>
        </Link>
        <NavLink className="nav-link" to="/create">
               Create Record
             </NavLink>
        {/* <Link to={'/archive'} className='linkstyle'>
        <button className='button1 storybutton'>BROWSE THE ARCHIVE</button>
        </Link> */}
        <div className='topic-container'>
          <hr></hr>
          <button className = {`topic ${topic == 'all' ? 'selected': ''}`} onClick={() => setTopic('all')}>ALL</button>
          <button className = {`topic ${topic == 'immigration' ? 'selected': ''}`} onClick={() => setTopic('immigration')}>IMMIGRATION</button>
          <button className = {`topic ${topic == 'love' ? 'selected': ''}`} onClick={() => setTopic('love')}>LOVE&KINDNESS</button>
          <button className = {`topic ${topic == 'friend' ? 'selected': ''}`} onClick={() => setTopic('friend')}>FRIENDSHIP</button>
          <button className = {`topic ${topic == 'family' ? 'selected': ''}`} onClick={() => setTopic('family')}>FAMILY</button>          
          <button className = {`topic ${topic == 'loss' ? 'selected': ''}`} onClick={() => setTopic('loss')}>LOSS</button>
          <button className = {`topic ${topic == 'grow' ? 'selected': ''}`} onClick={() => setTopic('grow')}>GROWING</button>
          <button className = {`topic ${topic == 'career' ? 'selected': ''}`} onClick={() => setTopic('career')}>CAREERS&PASSIONS</button>
          <button className = {`topic ${topic == 'faith' ? 'selected': ''}`} onClick={() => setTopic('faith')}>FAITH</button>
          <hr></hr>
        </div>
        <div className='photo-board'>
          <div className='col'>
            {col1}
          </div>
          <div className='col'>
            {col2}
          </div>
          <div className='col'>
            {col3}
          </div>
        </div>


      </div>
    </div>
  );
}

export default Main;
